package test;public class FixedStack implements DefStack {    int stck[];    int tos;    String name;    FixedStack(int size, String s) {        stck = new int[size];        name = s;        tos = -1;    }    public void push(int item) {        if (tos == stck.length - 1) {            System.out.println("Стек заповнений");        } else {            stck[++tos] = item;        }    }    public int pop() {        if (tos < 0) {            System.out.println("Стек пустий");            return 0;        } else {            return stck[tos--];        }    }    public void defoult() {        if (tos == stck.length - 1) {            System.out.println("Стек заповнений");        } else {            stck[++tos] = 1;        }    }}